const AboutMe = () => {
  return (
    <div id="infomatic">
      <p>
        Born in New Jersey. Grew up in Pennsylvania. Went to college in Indiana.
        Spent time in Tennessee and now living in Vermont. In my short time on this Earth
        I can say with some confidence that..I've been around; seeing a great
        many things in this world. It is with those experiences that I decided pursue a career
        in development. I seek to find ways to help bring us together {" "}
      </p>
    </div>
  );
};

export default AboutMe;
